	public int maxDepth(TreeNode root) {
		if (root == null) {
			return 0;
		}
		int res = 1;
		int lnodes = maxDepth(root.left);
		int rnodes = maxDepth(root.right);
		res += Math.max(lnodes, rnodes);
		return res;
	}

