	public int titleToNumber(String s) {
		int result = 0;
		int lenth = s.length();
		for (int i = lenth - 1; i > -1; i--) {
			result += Math.pow(26, (lenth - 1 - i)) * convert(s.charAt(i));
		}
		return result;
	}

