	public ListNode reverseListRecursive(ListNode head) {
		if (head == null || head.next == null) {
			return head;
		}
		ListNode res = reverseListRecursive(head.next);
		head.next.next = head;
		head.next = null;
		return res;
	}

	// 
	public ListNode reverseList(ListNode head) {
		int i = 0;
		ListNode res = head;
		if (res != null) {
			ListNode temp = head.next;
			while (temp != null) {
				res = temp;
				temp = temp.next;
				res.next = head;
				if (i == 0) {
					++i;
					head.next = null;
				}
				head = res;
			}
		}
		return res;
	}

